\captionsetup{labelformat=empty}
\caption{Fig. 1. We optimize a hex-mesh (a) with multiple inverted (red) elements. We first obtain a target surface (b) by aligning boundary vertices to features. We then produce an inversion-free mesh (d) with large surface distance error via optimizing the local regions (c) using a soft constraint on the surface. Next, we use inversion-free deformation to pull the surface of (d) back to the one obtained in (b) and obtain an inversion-free mesh (e). Using a hard constraint on the surface, we further optimize the mesh to improve its MSJ with low surface distance error (f).}
\end{figure}

